    public static int minOperations(int[] nums) {
        List<Integer> list = new ArrayList();;
        for(Integer n:nums){
            list.add(n);
        }
        int mimimumsteps=Integer.MAX_VALUE;
        Arrays.sort(nums);
        for(int j=0;j<nums.length;j++){
            int minimum= nums[j];
            int counter=0;
            for(int i=minimum;i<minimum+nums.length;i++){
                if(!binarySearch(nums,0,nums.length-1,i)){
                    counter= counter+1;
                }
            }
            if(mimimumsteps>counter){
                mimimumsteps = counter;
            }
        }
        return mimimumsteps;
    }

    public static boolean binarySearch(int[] array,int start,int end,int element){
        while(start<=end){
            int mid= (start+ end)/2;
            if(array[mid]<element){
                start=mid+1;
            }else if(array[mid]>element){
                end =mid-1;
            }else{
                return true;
            }
        }
        return false;
    }
